        let chart, candleSeries, seriesMarkers;
        let bbUpperLine, bbMiddleLine, bbLowerLine;
        let rsiChart, rsiSeries, rsi70Line, rsi30Line;
        let markersVisible = true;
        let infoVisible = false;
        let indicatorsVisible = true;
        
        function initChart() {
            // Hide loading
            document.querySelector('.loading').style.display = 'none';
            
            const chartContainer = document.getElementById('chart-container');
            
            // Create chart
            chart = LightweightCharts.createChart(chartContainer, {
                width: chartContainer.clientWidth,
                height: chartContainer.clientHeight,
                layout: {
                    background: { type: 'solid', color: '#131722' },
                    textColor: '#d1d4dc',
                },
                grid: {
                    vertLines: { color: 'rgba(42, 46, 57, 0.3)' },
                    horzLines: { color: 'rgba(42, 46, 57, 0.3)' },
                },
                rightPriceScale: {
                    borderColor: '#2a2e39',
                    scaleMargins: {
                        top: 0.1,
                        bottom: 0.2,
                    },
                },
                timeScale: {
                    borderColor: '#2a2e39',
                    timeVisible: true,
                    secondsVisible: true,
                },
                crosshair: {
                    mode: LightweightCharts.CrosshairMode.Normal,
                },
            });
            
            // Add candlestick series
            try {
                // Try v5 API
                candleSeries = chart.addSeries(LightweightCharts.CandlestickSeries, {
                    upColor: '#26a69a',
                    downColor: '#ef5350',
                    borderUpColor: '#26a69a',
                    borderDownColor: '#ef5350',
                    wickUpColor: '#26a69a',
                    wickDownColor: '#ef5350',
                });
            } catch (e) {
                // Fallback to v4 API
                candleSeries = chart.addCandlestickSeries({
                    upColor: '#26a69a',
                    downColor: '#ef5350',
                    borderUpColor: '#26a69a',
                    borderDownColor: '#ef5350',
                    wickUpColor: '#26a69a',
                    wickDownColor: '#ef5350',
                });
            }
            
            // Set data
            candleSeries.setData(candleData);
            
            // Add Bollinger Bands lines
            if (bbUpperData.length > 0) {
                try {
                    // Try v5 API
                    bbUpperLine = chart.addSeries(LightweightCharts.LineSeries, {
                        color: 'rgba(255, 82, 82, 0.5)',
                        lineWidth: 1,
                        lineStyle: 2,
                        title: 'BB Upper',
                        priceLineVisible: false,
                    });
                } catch (e) {
                    // Fallback to v4 API
                    bbUpperLine = chart.addLineSeries({
                        color: 'rgba(255, 82, 82, 0.5)',
                        lineWidth: 1,
                        lineStyle: 2,
                        title: 'BB Upper',
                        priceLineVisible: false,
                    });
                }
                bbUpperLine.setData(bbUpperData);
                
                try {
                    bbMiddleLine = chart.addSeries(LightweightCharts.LineSeries, {
                        color: 'rgba(255, 255, 255, 0.3)',
                        lineWidth: 1,
                        lineStyle: 0,
                        title: 'BB Middle',
                        priceLineVisible: false,
                    });
                } catch (e) {
                    bbMiddleLine = chart.addLineSeries({
                        color: 'rgba(255, 255, 255, 0.3)',
                        lineWidth: 1,
                        lineStyle: 0,
                        title: 'BB Middle',
                        priceLineVisible: false,
                    });
                }
                bbMiddleLine.setData(bbMiddleData);
                
                try {
                    bbLowerLine = chart.addSeries(LightweightCharts.LineSeries, {
                        color: 'rgba(38, 166, 154, 0.5)',
                        lineWidth: 1,
                        lineStyle: 2,
                        title: 'BB Lower',
                        priceLineVisible: false,
                    });
                } catch (e) {
                    bbLowerLine = chart.addLineSeries({
                        color: 'rgba(38, 166, 154, 0.5)',
                        lineWidth: 1,
                        lineStyle: 2,
                        title: 'BB Lower',
                        priceLineVisible: false,
                    });
                }
                bbLowerLine.setData(bbLowerData);
            }
            
            // Create separate RSI chart
            if (rsiData.length > 0) {
                const rsiContainer = document.getElementById('rsi-container');
                
                rsiChart = LightweightCharts.createChart(rsiContainer, {
                    width: rsiContainer.clientWidth,
                    height: rsiContainer.clientHeight,
                    layout: {
                        background: { type: 'solid', color: '#131722' },
                        textColor: '#d1d4dc',
                    },
                    grid: {
                        vertLines: { color: 'rgba(42, 46, 57, 0.3)' },
                        horzLines: { color: 'rgba(42, 46, 57, 0.3)' },
                    },
                    rightPriceScale: {
                        borderColor: '#2a2e39',
                        scaleMargins: {
                            top: 0.1,
                            bottom: 0.1,
                        },
                    },
                    timeScale: {
                        borderColor: '#2a2e39',
                        visible: true,
                        timeVisible: true,
                    },
                });
                
                // Add RSI line
                try {
                    rsiSeries = rsiChart.addSeries(LightweightCharts.LineSeries, {
                        color: '#2962ff',
                        lineWidth: 2,
                        title: 'RSI',
                    });
                } catch (e) {
                    rsiSeries = rsiChart.addLineSeries({
                        color: '#2962ff',
                        lineWidth: 2,
                        title: 'RSI',
                    });
                }
                rsiSeries.setData(rsiData);
                
                // Add 70 and 30 levels
                try {
                    rsi70Line = rsiChart.addSeries(LightweightCharts.LineSeries, {
                        color: 'rgba(255, 82, 82, 0.3)',
                        lineWidth: 1,
                        lineStyle: 3,
                        priceLineVisible: false,
                    });
                    rsi30Line = rsiChart.addSeries(LightweightCharts.LineSeries, {
                        color: 'rgba(38, 166, 154, 0.3)',
                        lineWidth: 1,
                        lineStyle: 3,
                        priceLineVisible: false,
                    });
                } catch (e) {
                    rsi70Line = rsiChart.addLineSeries({
                        color: 'rgba(255, 82, 82, 0.3)',
                        lineWidth: 1,
                        lineStyle: 3,
                        priceLineVisible: false,
                    });
                    rsi30Line = rsiChart.addLineSeries({
                        color: 'rgba(38, 166, 154, 0.3)',
                        lineWidth: 1,
                        lineStyle: 3,
                        priceLineVisible: false,
                    });
                }
                
                const rsi70Data = rsiData.map(d => ({time: d.time, value: 70}));
                const rsi30Data = rsiData.map(d => ({time: d.time, value: 30}));
                rsi70Line.setData(rsi70Data);
                rsi30Line.setData(rsi30Data);
                
                // Sync time scales
                chart.timeScale().subscribeVisibleLogicalRangeChange((logicalRange) => {
                    if (logicalRange) {
                        rsiChart.timeScale().setVisibleLogicalRange(logicalRange);
                    }
                });
                
                rsiChart.timeScale().subscribeVisibleLogicalRangeChange((logicalRange) => {
                    if (logicalRange) {
                        chart.timeScale().setVisibleLogicalRange(logicalRange);
                    }
                });
            }
            
            // Add markers if any
            if (markerData.length > 0) {
                try {
                    if (LightweightCharts.createSeriesMarkers) {
                        seriesMarkers = LightweightCharts.createSeriesMarkers(candleSeries, markerData);
                    } else {
                        candleSeries.setMarkers(markerData);
                    }
                } catch (e) {
                    console.log('Markers not supported');
                }
            }
            
            // Add crosshair handler
            chart.subscribeCrosshairMove((param) => {
                if (!param.time || !param.point) return;
                
                const data = param.seriesData.get(candleSeries);
                if (data) {
                    // Could update info panel with current bar data
                }
            });
            
            // Fit content
            chart.timeScale().fitContent();
            
            // Handle resize
            window.addEventListener('resize', () => {
                chart.applyOptions({
                    width: chartContainer.clientWidth,
                    height: chartContainer.clientHeight
                });
                if (rsiChart) {
                    const rsiContainer = document.getElementById('rsi-container');
                    rsiChart.applyOptions({
                        width: rsiContainer.clientWidth,
                        height: rsiContainer.clientHeight
                    });
                }
            });
            
            console.log('Chart loaded with ' + candleData.length + ' minute bars');
        }
        
        function resetView() {
            chart.timeScale().fitContent();
            if (rsiChart) rsiChart.timeScale().fitContent();
        }
        
        function toggleInfo() {
            infoVisible = !infoVisible;
            document.getElementById('info-panel').style.display = infoVisible ? 'block' : 'none';
        }
        
        function toggleMarkers() {
            markersVisible = !markersVisible;
            if (seriesMarkers) {
                seriesMarkers.setMarkers(markersVisible ? markerData : []);
            } else {
                try {
                    candleSeries.setMarkers(markersVisible ? markerData : []);
                } catch (e) {}
            }
        }
        
        function zoomIn() {
            const range = chart.timeScale().getVisibleLogicalRange();
            if (range) {
                const center = (range.from + range.to) / 2;
                const newWidth = (range.to - range.from) * 0.5;
                chart.timeScale().setVisibleLogicalRange({
                    from: center - newWidth / 2,
                    to: center + newWidth / 2
                });
            }
        }
        
        function zoomOut() {
            const range = chart.timeScale().getVisibleLogicalRange();
            if (range) {
                const center = (range.from + range.to) / 2;
                const newWidth = (range.to - range.from) * 2;
                chart.timeScale().setVisibleLogicalRange({
                    from: center - newWidth / 2,
                    to: center + newWidth / 2
                });
            }
        }
        
        function toggleIndicators() {
            indicatorsVisible = !indicatorsVisible;
            if (bbUpperLine) bbUpperLine.applyOptions({ visible: indicatorsVisible });
            if (bbMiddleLine) bbMiddleLine.applyOptions({ visible: indicatorsVisible });
            if (bbLowerLine) bbLowerLine.applyOptions({ visible: indicatorsVisible });
            if (rsiChart) {
                const rsiContainer = document.getElementById('rsi-container');
                rsiContainer.style.display = indicatorsVisible ? 'block' : 'none';
            }
        }
        
        function toggleBB() {
            if (bbUpperLine) {
                const currentVisible = bbUpperLine.options().visible !== false;
                bbUpperLine.applyOptions({ visible: !currentVisible });
                bbMiddleLine.applyOptions({ visible: !currentVisible });
                bbLowerLine.applyOptions({ visible: !currentVisible });
            }
        }
        
        function toggleRSI() {
            if (rsiChart) {
                const rsiContainer = document.getElementById('rsi-container');
                const isVisible = rsiContainer.style.display !== 'none';
                rsiContainer.style.display = isVisible ? 'none' : 'block';
                if (!isVisible && rsiChart) {
                    rsiChart.applyOptions({
                        width: rsiContainer.clientWidth,
                        height: rsiContainer.clientHeight
                    });
                }
            }
        }
        
        function analyzeDay() {
            const totalBars = candleData.length;
            const firstBar = candleData[0];
            const lastBar = candleData[candleData.length - 1];
            const dayReturn = ((lastBar.close / firstBar.open - 1) * 100).toFixed(2);
            
            let highBar = candleData[0];
            let lowBar = candleData[0];
            
            candleData.forEach(bar => {
                if (bar.high > highBar.high) highBar = bar;
                if (bar.low < lowBar.low) lowBar = bar;
            });
            
            const highTime = new Date(highBar.time * 1000).toLocaleTimeString();
            const lowTime = new Date(lowBar.time * 1000).toLocaleTimeString();
            
            alert(`August 20, 2025 Analysis\n\n` +
                  `Total Bars: ${totalBars}\n` +
                  `Open: ${firstBar.open.toFixed(2)}\n` +
                  `Close: ${lastBar.close.toFixed(2)}\n` +
                  `High: ${highBar.high.toFixed(2)} @ ${highTime}\n` +
                  `Low: ${lowBar.low.toFixed(2)} @ ${lowTime}\n` +
                  `Day Return: ${dayReturn}%\n` +
                  `Range: ${(highBar.high - lowBar.low).toFixed(2)} points\n` +
                  `\nPotential Signals: ${markerData.length}`);
        }
        
        // Initialize on load
        document.addEventListener('DOMContentLoaded', initChart);
    </script>
